INSERT INTO `cms_article_data` VALUES ('24', '                                                                                                                                                                                                                                                                                                                                                                        <p><span style=\"line-height: 1.6;\"></span></p><p>&nbsp; &nbsp; 我们只是做了大多数人不愿意做的事情。</p><p>&nbsp; &nbsp; 我们的理想是？</p><p>&nbsp;&nbsp;&nbsp;&nbsp;程序员工具能做的事情，我们坚决不自己做。</p>\r\n                                \r\n                                <p>&nbsp; &nbsp; 我们的愿景是？</p><p>&nbsp; &nbsp; 项目就像打积木一样，各种插件的集合就组成了一个项目。</p><p>&nbsp; &nbsp; 我们有什么？</p><p>&nbsp; &nbsp; 一套基础平台、一个代码生成器、N多常用插件。</p>\r\n                                \r\n                                <p><br></p>\r\n                                \r\n                                \r\n                                \r\n                                ', '程序员工具', '0'), ('27', '                                                                                                                                                                                                                                                                                                                                    <p><font size=\"2\">程序员工具升级到V2.0啦，速去围观<a href=\"https://git.oschina.net/TokenHuang/iutils-admin\" target=\"_blank\" style=\"line-height: 1; background-color: rgb(255, 255, 255);\">程序员工具之基础平台建设</a>。关注最新的动态通知请进QQ群：460229964</font></p>\r\n                                <p><br></p>\r\n                                \r\n                                \r\n                                \r\n                                \r\n                                \r\n                                \r\n                                \r\n                                ', '', '0'), ('30', '<p>安装目录下，bin目录内</p><p>Windows，文件idea.exe.vmoptions</p><p>Mac，<span style=\"line-height: 25.6px; white-space: normal;\">文件</span><span style=\"line-height: 25.6px; white-space: normal;\">idea.vmoptions</span></p><p>最大的修改下-Xmx1024m</p>', '程序员工具', '0'), ('31', '<p>在.settings子目录里面，用文本编辑器打开org.eclipse.wst.common.project.facet.core.xml配置文件，让它与项目的编译器版本设置保持一致即可。</p>', '程序员工具', '0'), ('32', '<p>clean package &nbsp;同时勾上offline</p>', '程序员工具', '0'), ('33', '<p>jps 命令 查看java相关线程的pid</p><p>jmap pid 打印内存使用的摘要信息</p><p>jmap -histo pid &gt;mem.txt 打印比较简单的各个有多少个对象占了多少内存的信息，一般重定向的文件</p><p>jmap -dump:format=b,file=mem.dat pid &nbsp;将内存使用的详细情况输出到mem.dat 文件</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 用jhat命令可以参看 jhat -port 7000 mem.dat&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 在浏览器中访问：http://10.5.22.65:7000/ &nbsp;查看详细信息</p><p><br/></p>', '程序员工具', '0'), ('34', '<p>ps -ef</p><p>ps aux</p><p>ps -ef|grep python3</p>', '程序员工具', '0'), ('35', '<p>ssh root@IP</p><p>输入链接密码即可</p>', '程序员工具', '0'), ('36', '<p>scp 本地文件路径 root@IP:服务文件路径</p><p>如：<span style=\"line-height: 25.6px; white-space: normal;\"></span><span style=\"line-height: 25.6px; white-space: normal;\">scp /Users/mac/<span style=\"white-space: nowrap;\">Downloads/1.zip</span>&nbsp;root@IP:/usr/local/</span></p><p>然后提示输入密码，即可出现上传进度</p>', '程序员工具', '0'), ('37', '<p>su － oracle</p><p>sqlplus /nolog</p><p>conn 用户/秘密</p><p><br/></p>', '程序员工具', '0'), ('38', '<p>启动应用的命令后面带上&nbsp;&amp; 符号</p>', '程序员工具', '0'), ('39', '<p>1、下载 git clone git@地址</p><p>2、更新&nbsp;git pull origin</p>', '程序员工具', '0'), ('40', '<p style=\"color: rgb(0, 0, 0); white-space: normal; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 13px;\"><span style=\"line-height: 1.6;\"># uname -a # 查看内核/操作系统/CPU信息</span></p><p style=\"color: rgb(0, 0, 0); white-space: normal; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 13px;\"># head -n 1 /etc/issue # 查看操作系统版本<br style=\"background-color: inherit;\"/># cat /proc/cpuinfo # 查看CPU信息<br style=\"background-color: inherit;\"/># hostname # 查看计算机名<br style=\"background-color: inherit;\"/># lspci -tv # 列出所有PCI设备<br style=\"background-color: inherit;\"/># lsusb -tv # 列出所有USB设备<br style=\"background-color: inherit;\"/># lsmod # 列出加载的内核模块<br style=\"background-color: inherit;\"/># env # 查看环境变量 资源<br style=\"background-color: inherit;\"/># free -m # 查看内存使用量和交换区使用量<br style=\"background-color: inherit;\"/># df -h # 查看各分区使用情况<br style=\"background-color: inherit;\"/># du -sh # 查看指定目录的大小<br style=\"background-color: inherit;\"/># grep MemTotal /proc/meminfo # 查看内存总量<br style=\"background-color: inherit;\"/># grep MemFree /proc/meminfo # 查看空闲内存量<br style=\"background-color: inherit;\"/># uptime # 查看系统运行时间、用户数、负载<br style=\"background-color: inherit;\"/># cat /proc/loadavg # 查看系统负载 磁盘和分区<br style=\"background-color: inherit;\"/># mount | column -t # 查看挂接的分区状态<br style=\"background-color: inherit;\"/># fdisk -l # 查看所有分区<br style=\"background-color: inherit;\"/># swapon -s # 查看所有交换分区<br style=\"background-color: inherit;\"/># hdparm -i /dev/hda # 查看磁盘参数(仅适用于IDE设备)<br style=\"background-color: inherit;\"/># dmesg | grep IDE # 查看启动时IDE设备检测状况 网络<br style=\"background-color: inherit;\"/># ifconfig # 查看所有网络接口的属性<br style=\"background-color: inherit;\"/># iptables -L # 查看防火墙设置<br style=\"background-color: inherit;\"/># route -n # 查看路由表<br style=\"background-color: inherit;\"/># netstat -lntp # 查看所有监听端口<br style=\"background-color: inherit;\"/># netstat -antp # 查看所有已经建立的连接<br style=\"background-color: inherit;\"/># netstat -s # 查看网络统计信息 进程<br style=\"background-color: inherit;\"/># ps -ef # 查看所有进程<br style=\"background-color: inherit;\"/># top # 实时显示进程状态 用户<br style=\"background-color: inherit;\"/># w # 查看活动用户<br style=\"background-color: inherit;\"/># id # 查看指定用户信息<br style=\"background-color: inherit;\"/># last # 查看用户登录日志<br style=\"background-color: inherit;\"/># cut -d: -f1 /etc/passwd # 查看系统所有用户</p><p style=\"color: rgb(0, 0, 0); white-space: normal; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 13px;\"># cut -d: -f1 /etc/group # 查看系统所有组<br style=\"background-color: inherit;\"/># crontab -l # 查看当前用户的计划任务 服务<br style=\"background-color: inherit;\"/># chkconfig –list # 列出所有系统服务<br style=\"background-color: inherit;\"/># chkconfig –list | grep on # 列出所有启动的系统服务 程序<br style=\"background-color: inherit;\"/># rpm -qa # 查看所有安装的软件包</p><p><br/></p>', '程序员工具', '0'), ('41', '                                                                        <p>&nbsp;&nbsp;&nbsp;&nbsp;删除solr索引数据</p><pre style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 22px; font-size: 12px; color: rgb(0, 0, 0); line-height: 18px; font-family: \'Courier New\' !important;\"><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&lt;</span><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">delete</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;&lt;</span><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">id</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;</span>1<span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\"><!--</span--><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">id</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;<!--</span--><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">delete</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&lt;</span><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">commit</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">/&gt;</span></span></span></pre><pre style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 22px; font-size: 12px; color: rgb(0, 0, 0); line-height: 18px; font-family: \'Courier New\' !important;\"><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&lt;</span><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">delete</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;&lt;</span><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">query</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;</span>id:1<span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\"><!--</span--><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">query</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;<!--</span--><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">delete</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&lt;</span><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">commit</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">/&gt;</span></span></span></pre><p>&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;删除所有的索引</p><pre style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 22px; font-size: 12px; color: rgb(0, 0, 0); line-height: 18px; font-family: \'Courier New\' !important;\"><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&lt;</span><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">delete</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;&lt;</span><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">query</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;</span>*:*<span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\"><!--</span--><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">query</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;<!--</span--><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">delete</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&gt;</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">&lt;</span><span style=\"color: rgb(128, 0, 0); line-height: 1.5 !important;\">commit</span><span style=\"color: rgb(0, 0, 255); line-height: 1.5 !important;\">/&gt;</span></span></span></pre><p><span style=\"color:#ff0000;font-size:12px\"><br></span></p><p><span style=\"line-height: 1; font-size: 1.6rem;\">&nbsp; &nbsp;&nbsp;</span><span style=\"color:#ff0000;font-size:12px\">注意：commit为提交事务动作，不可缺少，不然删除无效</span></p>\r\n                                <p><br></p>\r\n                                ', '程序员工具', '0'), ('42', '<p>1、防止修改别人的帐号信息？</p><p>问题场景：当用户登录后，如果知道了其他账户的ID，可能通过信息编辑界面修改信息。</p><p>解决方案：通过权限控制，用户所在的机构如果低于或等于修改用户的机构，禁止修改。</p><p>2、防止用户修改敏感信息？</p><p>问题场景：当用户登录后，可以修改个人资料，如果一些敏感字断没有做控制，可能可以直接修改。</p><p>解决方案：修改语句删除掉修改敏感的字段，敏感字段单独写方法修改。</p><p><br/></p><p>待续。。</p>', '程序员工具', '0'), ('44', '                                                                                                                                                                                                                                                                                                                                                                        <p>以<a href=\"https://git.oschina.net/TokenHuang/iutils-admin\" target=\"_blank\">iutils-admin</a>为基础核心平台，扩展项目开发中常用的基础插件，让开发项目就像搭积木一样有趣。</p>\r\n                                \r\n                                \r\n                                \r\n                                \r\n                                <p>目前已开放的插件</p><p>1、<span style=\"line-height: 1; font-size: 1.6rem;\">代码生成工具 <a href=\"https://git.oschina.net/TokenHuang/iutils-code\" target=\"_blank\">iutils-code</a></span></p>\r\n                                \r\n                                \r\n                                <p>2、<span style=\"line-height: 1; font-size: 1.6rem;\"><a href=\"https://git.oschina.net/TokenHuang/iutils-cms\" target=\"_blank\">iutils-cms</a>&nbsp;最适合程序员的内容管理系统</span></p><p><span style=\"line-height: 1; font-size: 1.6rem;\">3、</span><span style=\"line-height: 1; font-size: 1.6rem;\">字典管理插件 <a href=\"https://git.oschina.net/TokenHuang/iutils-dict\" target=\"_blank\">iutils-dict</a></span></p><p>4、<span style=\"line-height: 1; font-size: 1.6rem;\">文档操作插件 <a href=\"https://git.oschina.net/TokenHuang/iutils-office\" target=\"_blank\">iutils-office</a></span></p><p>计划中的插件（排名不分先后，开放后会更新到插件列表，敬请关注）</p><p>1、公共评论插件</p><p>2、留言板插件</p><p>3、附件服务插件</p><p>4、公共论坛插件</p><p>5、e<span style=\"font-size: 1.6rem;\">charts图表插件</span></p><p><span style=\"font-size: 1.6rem;\">6、收藏插件</span></p><p><span style=\"font-size: 1.6rem;\">7、在线问答插件</span></p><p><span style=\"font-size: 1.6rem;\">8、关注插件</span></p><p><span style=\"font-size: 1.6rem;\">9、在线表单插件</span></p><p>10、知识库插件</p><p>11、第三方登录插件</p><p>12、站内信插件</p><p>13、支付插件</p><p>14、签到插件</p><p>15、点赞插件</p><p>16、查看数插件</p><p>17、微信公众号插件</p><p><br></p>', '程序员工具', '0'), ('45', '<p><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\">1，启动SVN&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\"/><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\">sudo svnserve -d -r /home/data/svn/&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\"/><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\">其中 -d 表示守护进程， -r 表示在后台执行&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\"/><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\">/home/data/svn/&nbsp; 为svn的安装目录&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\"/><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\">2，关闭SVN&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\"/><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\">这里采取linux杀死进程的方式处理的&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\"/><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\">ps -ef|grep svnserve&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\"/><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\">root&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4967&nbsp;&nbsp;&nbsp;&nbsp; 1&nbsp; 0 Aug23 ?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 00:00:00 svnserve -d -r repository/&nbsp;&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\"/><span style=\"color: rgb(0, 0, 0); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 25.2px; white-space: normal;\">这里&nbsp; kill -9 4967杀死进程， 此4967为进程号</span></p>', '', '0'), ('46', '<p>&nbsp;&lt;![CDATA[ sql语句包含起来 ]]&gt;</p>', '', '0'), ('47', '                                    <p>1、进入目录 cd /usr/local/solr/solr/server/solr/</p>\r\n                                <p>2、新建核心文件夹 mkdir content1</p><p>3、拷贝 cp -r configsets/sample_techproducts_configs/<span style=\"font-size: 1.6rem;\">conf/</span><span style=\"font-size: 1.6rem;\">&nbsp;</span>content1<span style=\"font-size: 1.6rem;\">/</span></p><p>4、然后在页面上就能新建核心<span style=\"line-height: 1; font-size: 1.6rem;\">content1了</span></p><p><br></p>', '程序员工具', '0'), ('48', '                                    \r\n                                <p>1、检查服务状态&nbsp;<span style=\"font-size: 1.6rem;\">service solr status</span></p><p>2、启动服务&nbsp;<span style=\"line-height: 1; font-size: 1.6rem;\">./bin/solr start</span></p><p>3、关闭服务 ps -ef|grep solr &nbsp;kill -9 服务id</p>', '程序员工具', '0'), ('49', '                                    \r\n                                <pre>clean install -Dmaven.test.skip=true -U</pre><p><br></p>', '程序员工具', '0'), ('62', '<p>var values = [1,2,3,4,5];<br>var min=Math.min.apply(null,&nbsp;values);</p><p><span style=\"font-size: 1.6rem;\">var max=Math.max.apply(null,&nbsp;values);</span></p><p><br></p>', '', '0'), ('63', '                                                                                                                                                                                                                                                                                                                                                                        <p>我们是一群研究技术的技术宅，欢迎大家进群交流</p><p>QQ交流群<span style=\"font-size: 1.6rem;\">：</span><span style=\"font-size: 1.6rem;\">460229964</span></p><p><span style=\"font-size: 1.6rem;\"><br></span></p><p><span style=\"font-size: 1.6rem;\">QQ二维码：</span><img src=\"/static/upload/127.0.0.1_1488869170151.png\" alt=\"1488868861070\" style=\"line-height: 1; font-size: 1.6rem; max-width: 100%; width: 141px; height: 126px;\" class=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size: 1.6rem;\">微信交流群： &nbsp;</span><img src=\"/static/upload/127.0.0.1_1488869320048.png\" alt=\"960524D3-E8D8-4825-8253-DE16B9CAB792\" class=\"clicked\" style=\"font-size: 1.6rem; line-height: 1; max-width: 100%; width: 130px; height: 117px;\"></p><p><br></p>\r\n                                \r\n                                \r\n                                \r\n                                ', '程序员工具', '0'), ('71', '<p>fn:contains 判断字符串是否包含另外一个字符串 &lt;c:if test=\"${fn:contains(name, searchString)}\"&gt;</p><p>fn:containsIgnoreCase 判断字符串是否包含另外一个字符串(大小写无关) &lt;c:if test=\"${fn:containsIgnoreCase(name, searchString)}\"&gt;</p><p>fn:endsWith 判断字符串是否以另外字符串结束 &lt;c:if test=\"${fn:endsWith(filename, \".txt\")}\"&gt;</p><p>fn:escapeXml 把一些字符转成XML表示，例如 &lt;字符应该转为&lt; ${fn:escapeXml(param:info)}</p><p>fn:indexOf 子字符串在母字符串中出现的位置 ${fn:indexOf(name, \"-\")}</p><p>fn:join 将数组中的数据联合成一个新字符串，并使用指定字符格开 ${fn:join(array, \";\")}</p><p>fn:length 获取字符串的长度，或者数组的大小 ${fn:length(shoppingCart.products)}</p><p>fn:replace 替换字符串中指定的字符 ${fn:replace(text, \"-\", \"?\")}</p><p>fn:split 把字符串按照指定字符切分 ${fn:split(customerNames, \";\")}</p><p>fn:startsWith 判断字符串是否以某个子串开始 &lt;c:if test=\"${fn:startsWith(product.id, \"100-\")}\"&gt;</p><p>fn:substring 获取子串 ${fn:substring(zip, 6, -1)}</p><p>fn:substringAfter 获取从某个字符所在位置开始的子串</p><p>${fn:substringAfter(zip, \"-\")}</p><p>fn:substringBefore 获取从开始到某个字符所在位置的子串 ${fn:substringBefore(zip, \"-\")}</p><p>fn:toLowerCase 转为小写 ${fn.toLowerCase(product.name)}</p><p>fn:toUpperCase 转为大写字符 ${fn.UpperCase(product.name)}</p><p>fn:trim 去除字符串前后的空格 ${fn.trim(name)}</p><p><br></p>', '程序员工具', '0'), ('72', '                                                                                                                                                                                    \r\n                                <p>1、从代码服务下载搭建好的快速基础项目</p><p><a href=\"https://git.oschina.net/TokenHuang/fast-iutils-demo\" target=\"_blank\">https://git.oschina.net/TokenHuang/fast-iutils-demo</a></p><p><br></p><p>2、修改项目名称，将pom.xml文件中的fast-iutils-demo批量替换成自己项目名</p><p><br></p><p>3、导入到代码设计器，分<span style=\"line-height: 1; font-size: 1.6rem;\">eclipse和IDEA两种情况。</span></p><p><span style=\"line-height: 1; font-size: 1.6rem;\">&nbsp; &nbsp; &nbsp; eclipse的开发环境，</span>用mvn eclipse:eclipse命令将maven项目转成<span style=\"line-height: 1; font-size: 1.6rem;\">eclipse能够认识的项目结构。然后配置tomcat运行，<font color=\"#ff0000\">如果发现tomcat找不到项目的情况，请参考帖（将纯maven项目转成web项目）</font>子</span><a href=\"http://blog.csdn.net/hongchangfirst/article/details/7896283\" target=\"_blank\" style=\"font-size: 1.6rem; background-color: rgb(255, 255, 255);\">http://blog.csdn.net/hongchangfirst/article/details/7896283</a></p><p><span style=\"line-height: 1; font-size: 1.6rem;\">&nbsp; &nbsp; &nbsp; IDEA的开发环境，直接导入到idea即可，基础配置IDEA会自行解决。</span></p><p><br></p><p>4、初始数据库导入，目前项目只支持mysql。</p><p>&nbsp; &nbsp; &nbsp;在mysql编辑器中新建数据库，如：db_iutils。然后将数据库脚本文件db/db_init.sql到改数据库下执行，就会得到初始数据。</p><p><br></p><p>5、启动运行。</p><p>&nbsp; &nbsp; &nbsp;启动tomcat，成功后，再在浏览器中输入<a href=\"http://localhost:8080/fast-iutils-demo\" target=\"_blank\" style=\"font-size: 1.6rem; background-color: rgb(255, 255, 255);\">http://localhost:8080/fast-iutils-demo</a></p><p>打开项目登录界面，输入账号密码（super/123456）。</p><p><br></p><p>6、扩展自己的业务模块。在java文件夹中新增代码。默认代码包名：cn.iutils 然后加模块名如：<span style=\"line-height: 1; font-size: 1.6rem;\">cn.iutils.demo</span></p><p><span style=\"line-height: 16px;\">项目结构请参考源码提供的项目结构。代码编写请参考项目的编写规范。规范代码，养成良好的编写习惯。</span></p>\r\n                                \r\n                                <p><br></p><p>7、代码编写规范，必看。</p><p><a href=\"http://iutils.cn/f/3/49/view/document.html?categoryId=89\" target=\"_blank\">http://iutils.cn/f/3/49/view/document.html?categoryId=89</a></p>\r\n                                \r\n                                <p><br></p>', '程序员工具', '0'), ('73', '<p>使用官方openfirre的mac安装包时，会把openfire安装在/usr/local/openfire目录下。</p><p>并且配置启动项：/Library/LaunchDaemons/org.jivesoftware.openfire.plist</p><p>以及系统控制面板：/Library/PreferencePanes/Openfire.prefPane</p><p>只需要在openfire关闭的情况下，执行以下的命令即可：</p><pre><code>sudo rm -rf /Library/PreferencePanes/Openfire.prefPane\r\n\r\nsudo rm -rf /usr/local/openfire\r\n\r\nsudo rm -rf /Library/LaunchDaemons/org.jivesoftware.openfire.plist</code></pre><p><br></p>', '程序员工具', '0'), ('74', '                                    <p>1、连接数据库 mysql -u root -p;</p><p>2、查看当前用户下的数据库&nbsp;<span style=\"font-size: 1.6rem;\">show databases;</span></p><p><span style=\"font-size: 1.6rem;\">3、使用某个数据库 use db_iutils;</span></p><p><span style=\"font-size: 1.6rem;\">4、查看当前数据库下的表 &nbsp;show tables;</span></p><p><span style=\"font-size: 1.6rem;\">5、查看某张表的字段 desc sys_user;</span></p><p><span style=\"font-size: 1.6rem;\">6、删除某张表&nbsp;</span><span style=\"line-height: 1; font-size: 1.6rem;\">drop table sys_user;</span></p><p>7、退出连接 exit;</p><p><br></p>\r\n                                ', '程序员工具', '0'), ('85', '<p>第一次用Mac做开发，在网上也搜索了一些环境变量配置的文章，在此总结一下以方便日后使用。</p><p>1、打开终端Terminal；</p><p>2、进入当前用户主目录，cd ~；</p><p>3、临时授权，sudo su；</p><p>4、输入密码（密码不显示）；</p><p>5、创建.bash_profile文件，touch .bash_profile（如果存在则不必新建，我的没有）；</p><p>6、打开.bash_profile文件，open .bash_profile（能打开则新建成功）；</p><p>7、输入jdk文件路径，系统默认的是1.6，我的是1.8，可以两个都配置，方便以后切换。</p><p>export JAVA_6_HOME=/Library/Java/JavaVirtualMachines/1.6.0.jdk/Contents/Home</p><p>export JAVA_8_HOME=/Library/Java/JavaVirtualMachines/jdk1.8.0_51.jdk/Contents/Home</p><p>export JAVA_HOME=$JAVA_8_HOME</p><p>保存并退出；</p><p>8、读取并执行文件中的命令，source .bash_profile；</p><p>9、在Terminal中输入java -version，显示jdk信息，则配置成功。</p><p><br></p>', '程序员工具', '0'), ('86', '                                                                                                                                                \r\n                                <p>个人开源项目的尴尬，资金有限，服务器资源昂贵，在此发起赞助计划，所有赞助款项均用于开源软件的发展。感谢大家的支持，你们支持是我们存在下去的动力<img src=\"http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/0b/tootha_thumb.gif\" style=\"line-height: 1; font-size: 1.6rem;\"></p><p><span style=\"line-height: 1; font-size: 1.6rem;\"><br></span></p>\r\n                                <p><img src=\"/static/upload/127.0.0.1_1488871320651.png\" alt=\"weixinshoukuan\" style=\"max-width: 100%; width: 344px; height: 422px;\" class=\"clicked\">&nbsp; &nbsp; &nbsp;<img src=\"/static/upload/127.0.0.1_1488871348929.jpg\" alt=\"zhifubaoshoukuan\" style=\"line-height: 1; font-size: 1.6rem; max-width: 100%; width: 323px; height: 422px;\" class=\"clicked\"><br style=\"line-height: 1; font-size: 1.6rem;\"></p><p><br></p>\r\n                                ', '程序员工具', '0'), ('87', '                                                                        \r\n                                <p>iutils-admin 基础平台插件</p><p><br></p>\r\n                                ', '', '0'), ('88', '                                                                        \r\n                                <p>iutils-code 代码生成工具</p><p><br></p>\r\n                                ', '', '0'), ('89', '                                                                        \r\n                                <p>iutils-cms 内容管理系统插件</p><p><br></p>\r\n                                ', '', '0'), ('90', '                                                                        \r\n                                <p>iutils-dict 系统字典插件</p><p><br></p>\r\n                                ', '', '0'), ('91', '                                                                        \r\n                                <p>iutils-office 文档插件</p><p><br></p>\r\n                                ', '', '0'), ('92', '                                                                        \r\n                                <p>程序员工具官网</p><p><br></p>\r\n                                ', '', '0'), ('93', '                                                                        \r\n                                <p>市场助手 - wap版</p><p><br></p>\r\n                                ', '', '0'), ('94', '                                    \r\n                                <p>瀚云信息官网</p><p><br></p>', '', '0'), ('95', '                                    \r\n                                <p>问答系统</p><p><br></p>', '', '0'), ('96', '                                                                                                                                                                                                                        \r\n                                <p><font size=\"3\">&nbsp; &nbsp; <b>黄超</b> &nbsp;iutils发起人，<span style=\"line-height: 1;\">平常</span>喜欢编程，擅长java、android和前端等技术。</font></p><p><font size=\"3\"><br></font></p><p><font size=\"3\">&nbsp; &nbsp; <b>林伏山</b> &nbsp;农家有菜发起人，<span style=\"line-height: 1;\">iutils合伙人，平时喜欢架构，研究组件与技术组合，擅长规则流、工作流、报表。喜欢用创新模式解决问题。</span></font></p><p><font size=\"3\"><span style=\"line-height: 1;\"><br></span></font></p><p><font size=\"3\">&nbsp;&nbsp;&nbsp;&nbsp;<b>陈婷</b> &nbsp;iutils合伙人，平常喜欢撩汉，擅长UI设计等技术。</font></p><p><font size=\"3\"><br></font></p><p><font size=\"3\">&nbsp; &nbsp; <b>戴平金</b> &nbsp;<span style=\"line-height: 1;\">iutils合伙人，擅长发散思维，喜欢思考。</span></font></p>\r\n                                \r\n                                \r\n                                <p><br></p>\r\n                                \r\n                                ', '', '0'), ('97', '                                    \r\n                                <p>iutils-guestbook&nbsp;留言板插件</p><p><br></p>', '', '0'), ('98', '                                    \r\n                                <p>iutils-comment&nbsp;评论插件</p><p><br></p>', '', '0'), ('99', '<p>代码编写说明</p><p>1、新建模块，默认包&nbsp;cn.iutils.demo，如要扩展另外的包，请同步修改spring的配置文件，</p><p>spring-config.xml和spring-mvc.xml。将这两个文件从源码包中拷贝到项目的resources资源目录下</p><p>然后，修改文件中的spring扫描配置</p><p>spring-config.xml：base-package=\"cn.iutils\"&nbsp;加入自己的包，如：&nbsp;base-package=\"cn.iutils,com.company\"</p><p>spring-config.xml：&lt;property&nbsp;name=\"basePackage\"&nbsp;value=\"cn.iutils\"/&gt;&nbsp;加入自己的包，如：&nbsp;&lt;property&nbsp;name=\"basePackage\"&nbsp;value=\"cn.iutils,com.company\"/&gt;</p><p>spring-mvc.xml：base-package=\"cn.iutils.**.controller\"&nbsp;加入自己的包，如：base-package=\"cn.iutils.**.controller,com.company.**.controller\"</p><p>2、新建子模块，以demo模块为例，一个模块中的代码怎么分类，</p><p>java（代码包）</p><p>&nbsp;&nbsp;&nbsp;&nbsp;controller（控制器）</p><p>&nbsp;&nbsp;&nbsp;&nbsp;dao（数据持久化）</p><p>&nbsp;&nbsp;&nbsp;&nbsp;entity（实体）</p><p>&nbsp;&nbsp;&nbsp;&nbsp;service（服务）</p><p>resources（配置文件）</p><p>&nbsp;&nbsp;&nbsp;&nbsp;mappings/demo（sql文件）</p><p>webapp（页面）</p><p>&nbsp;&nbsp;&nbsp;&nbsp;WEB-INF/view/demo/子模块（存放子模块页面）</p><p>3、怎样修改基础平台原来的页面或代码？</p><p>&nbsp;&nbsp;&nbsp;在自己的项目中，新建和基础平台相同的包名或文件名，然后将基础平台的页面或代码文件拷贝到自己的项目中，直接修改拷贝的文件即可。</p><p>4、怎样新增数据库表，有什么规则？</p><p>&nbsp;&nbsp;&nbsp;主键：固定用“id”命名，类型bigint，自动增长</p><p>&nbsp;&nbsp;&nbsp;建议每个业务表都加上，create_by（创建人）、create_date（创建时间）、update_by（修改人）、update_date（修改时间）、remarks（备注）、</p><p>&nbsp;&nbsp;&nbsp;status（状态）。</p><p>&nbsp;&nbsp;&nbsp;然后在根据自己的业务自行扩展字段。</p><p>5、新建表后，运行代码生成工具，将模块的代码自动生成，然后拷贝带项目中。</p>', '程序员工具', '0'), ('100', '<p>1、从代码服务下载搭建好的快速基础项目</p><p><a href=\"https://git.oschina.net/TokenHuang/fast-iutils-demo\" target=\"_blank\">https://git.oschina.net/TokenHuang/fast-iutils-demo</a></p><p>2、修改项目名称，将pom.xml文件中的fast-iutils-demo批量替换成自己项目名</p><p>3、导入到代码设计器，分eclipse和IDEA两种情况。</p><p>&nbsp; &nbsp; &nbsp; eclipse的开发环境，用mvn eclipse:eclipse命令将maven项目转成eclipse能够认识的项目结构。然后配置tomcat运行，如果发现tomcat找不到项目的情况，请参考帖（将纯maven项目转成web项目）子<a href=\"http://blog.csdn.net/hongchangfirst/article/details/7896283\" target=\"_blank\">http://blog.csdn.net/hongchangfirst/article/details/7896283</a></p><p>&nbsp; &nbsp; &nbsp; IDEA的开发环境，直接导入到idea即可，基础配置IDEA会自行解决。</p><p>4、初始数据库导入，目前项目只支持mysql。</p><p>&nbsp; &nbsp; &nbsp;在mysql编辑器中新建数据库，如：db_iutils。然后将数据库脚本文件db/db_init.sql到改数据库下执行，就会得到初始数据。</p><p>5、启动运行。</p><p>&nbsp; &nbsp; &nbsp;启动tomcat，成功后，再在浏览器中输入<a href=\"http://localhost:8080/fast-iutils-demo\" target=\"_blank\">http://localhost:8080/fast-iutils-demo</a></p><p>打开项目登录界面，输入账号密码（super/123456）。</p><p>6、扩展自己的业务模块。在java文件夹中新增代码。默认代码包名：cn.iutils 然后加模块名如：cn.iutils.demo</p><p>项目结构请参考源码提供的项目结构。代码编写请参考项目的编写规范。规范代码，养成良好的编写习惯。</p><p>7、代码编写规范，必看。</p><p><span style=\"background-color: rgb(255, 255, 255);\"><a href=\"http://iutils.cn/f/39/99/detail.html\" target=\"_blank\">http://iutils.cn/f/39/99/detail.html</a></span></p><p><br></p>', '程序员工具', '0'), ('101', '<p>1、进入到代码生成器目录/iutils-code/run/jar &nbsp;</p><blockquote>windows系统中运行代码生成器直接双击start.bat文件，mac系统中执行命令&nbsp;java&nbsp;-jar&nbsp;iutils-code.jar</blockquote><p>2、进入到代码生成器操作界面</p><p><img src=\"/static/upload/0_0_0_0_0_0_0_1_1489219707655.png\" alt=\"175\" style=\"max-width:100%;\"></p><p><br></p><p><img src=\"/static/upload/0_0_0_0_0_0_0_1_1489219719355.png\" alt=\"175\" style=\"max-width:100%;\"></p><p><br></p><p>3、生成完成后，会在当前目录下面生成一个mycode文件夹，生成后的代码存在在这个文件夹下面。然后拷贝带项目中对应的目录就好了。</p><p><br></p><p><br></p>', '程序员工具', '0');
COMMIT;

-- ----------------------------
--  Table structure for `cms_category`
-- ----------------------------
DROP TABLE IF EXISTS `cms_category`;
CREATE TABLE `cms_category` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `site_id` varchar(64) DEFAULT '1' COMMENT '站点编号',
  `parent_id` varchar(64) NOT NULL COMMENT '父级编号',
  `name` varchar(100) NOT NULL COMMENT '栏目名称',
  `module` varchar(50) DEFAULT 'nav' COMMENT '模块 默认导航',
  `show_home` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否在首页显示',
  `is_by` tinyint(1) NOT NULL COMMENT '是否有下级导航',
  `custom_view` varchar(50) NOT NULL COMMENT '自定义视图',
  `sort` int(11) DEFAULT '0' COMMENT '排序',
  `href` varchar(225) DEFAULT NULL COMMENT '访问地址',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `status` char(1) NOT NULL DEFAULT '0' COMMENT '状态',
  PRIMARY KEY (`id`),
  KEY `cms_category_parent_id` (`parent_id`),
  KEY `cms_category_name` (`name`),
  KEY `cms_category_sort` (`sort`),
  KEY `cms_category_status` (`status`),
  KEY `cms_category_site_id` (`site_id`)
) ENGINE=InnoDB AUTO_INCREMENT=176 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='栏目表';

