  `time_consuming` varchar(50) NOT NULL COMMENT '耗时',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1392 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='系统日志';

